import React from 'react';
import './intro.scss';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import GitHubIcon from '@material-ui/icons/GitHub';
import InstagramIcon from '@material-ui/icons/Instagram';
import TwitterIcon from '@material-ui/icons/Twitter';
export default function Intro() {
    return (
        <div className="intro" id="intro">
            <div className="initial" id="initial">
                <h1>Hi I am Abhyuday</h1>
            </div>
            
            <div className="about" id="about">
                <h3>Hey, this is my homepage, so I have to say something about myself. Sometimes it is hard to introduce yourself because you know yourself so well that you do not know where to start with. Let me give a try to see what kind of image you have about me through my self-description. I hope that my impression about myself and your impression about me are not so different. </h3>
            </div>
            <div className="icons" id="icons">
                <LinkedInIcon/>
                <GitHubIcon/>
                <InstagramIcon/>
                <TwitterIcon/>
            </div>
        </div>
    )
}
